const getAll = () => {
  return httpClient.get("/security/admin/t");
};

const update = (id) => {
  return httpClient.put("/bookingdetails/u/$id", id);
};
const create = (data) => {
  return httpClient.post("/security/user/b/i", data);
};
const remove = ({ train_no }) => {
  return httpClient.delete(`/traindetails/d/${train_no}`);
};
export default { create, getAll, update };
